import React from "react";

/**
 * Popup that pops up on success order
 */
const SuccessOrderPopup = ({ isOpen, onClose, onAction }) => {
  if (!isOpen) return null;

  return (
    <div className="w-96 z-10 bg-white absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 shadow-md border border-slate-200">
      SuccessOrderPopup
    </div>
  );
};

export default SuccessOrderPopup;
